  false,\n\t\"url\": null,\n\t\"notes\": \"The California Land Conservation Act of
  1965 - commonly referred to as the Williamson Act - is the State's primary program
  for the conservation of private land in agricultural and open space use. It is a
  voluntary, locally administered program that offers preferential property taxes
  on lands which have enforceable restrictions on their use via contracts between
  individual landowners and local governments. For more information on the Williamson
  Act please contact the Department of Conservation,\",\n\t\"license_title\": null,\n\t\"extras\":
